function Welcome(props) {
    return <h1>Hello, {props.name}</h1>;
  }

  const element = <Welcome name="Sara" />;

  class HelloApp extends React.Component {
    
	render(element) {
		return <h1>Ahoy! React</h1>
	}
}

export default HelloApp
